  <p>\u041C\u0435\u0440\u0435\u0436\u0430 \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0447\u0438\u0445 \u0430\u043F\u0442\u0435\u043A \xAB\u0415\u043A\u043E\u0444\u0430\u0440\u043C\xBB \u0440\u043E\u0437\u0448\u0438\u0440\u044E\u0454\u0442\u044C\u0441\u044F: \u043F\u0435\u0440\u0448\u0443 \u0432\u0436\u0435 \u0432\u0456\u0434\u043A\u0440\u0438\u0442\u043E!</p>
